import React from 'react';

export default function Form() {
    return (
    <div className="form">
    <p>Fill out the form below to request services or more information </p>
    <form>
        <input required placeholder='First name'></input>
        <input required placeholder='Last name'></input>
        <input required placeholder='Email'></input>
        <select className="dropDown">
            <option value="Overnight boarding">Overnight boarding</option>
            <option value="Daycare">Daycare</option>
            <option value="Walking">Walking</option>
        </select>
        <textarea placeholder='Have questions? Fill them out here'></textarea>
        <button type="submit">Submit</button>
    </form>
    </div>

        );
}
